import React from 'react'
import ImageShow from "./ImageShow";


function ImageList({ images }) {
    const renderedImages = images.map((image) => {
        return <ImageShow image={image} />
    })
    return (
        <div>ImageList: {images.length}</div>
    )
}

export default ImageList;
